import React from 'react';
import { Routes, Route } from "react-router-dom";
import Home from './Pages/Home';

function App() {
  return (
    <>
      <div className='cotainer mt-4'>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
      </div>
    </>
  );
}

export default App;
